(128, 1, '2020-03-09 04:06:58', '2020-03-09 04:06:58', '<!-- wp:paragraph -->\n<p> Dinas Komunikasi dan Informatika (Dinkominfo) Kabupaten Purbalingga, Jawa Tengah terus berupaya mensosialisasikan aplikasi pengaduan masyarakat âMatur Bupatiâ. Baik melalui media online, media cetak, radio, baliho, banner dan leaflet. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {"id":58} -->\n<figure class="wp-block-image"><img src="http://localhost/desa/wp-content/uploads/2020/03/poster-maturbup-1.jpg" alt="" class="wp-image-58"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Kepala Bidang Informatika Dinkominfo Kabupaten Purbalingga, Hari Sutito, mengatakan bagi masyarakat Purbalingga yang ingin menyampaikan saran, aspirasi, aduan maupun laporan terkait pelayanan publik dan penyelenggaraan pemerintah serta pembangunan di Kabupaten Purbalingga dapat disalurkan melalui aplikasi pengaduan online âMatur Bupatiâ yang dibuat oleh tim bidang Informatika.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Selain âMatur Bupatiâ versi web yang sebelumnya telah dilaunching pada 1 Oktober 2018, pada 21 Januari 2020 juga telah dirilis âMatur Bupatiâ versi mobile. Dan untuk versi web dapat diakses melalui browser internet dengan alamat maturbup.purbalinggakab.go.id. Dan untuk versi mobile bisa diunduh melalui play store, dengan kata kunci Matur Bupati Purbalingga. (*inf)</p>\n<!-- /wp:paragraph -->', 'DINKOMINFO PURBALINGGA TERUS SOSIALISASIKAN APLIKASI PENGADUAN âMATUR BUPATIâ', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2020-03-09 04:06:58', '2020-03-09 04:06:58', '', 1, 'http://localhost/desa/2020/03/09/1-revision-v1/', 0, 'revision', '', 0),
(129, 1, '2020-03-09 04:08:49', '2020-03-09 04:08:49', '<!-- wp:paragraph -->\n<p>Sebagai salah satu wujud keterbukaan informasi publik dan transparansi Penyelenggaraan Pemerintah Desa, Dinas Komunikasi dan Informatika (Dinkominfo) kabupaten Purbalingga memfasilitasi pendaftaran domain desa.id dan pembuatan website resmi untuk Pemerintah Desa.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kepala Seksi Aplikasi dan Infrastruktur TIK Dinkominfo Purbalingga, Baryati mengatakan bahwa sampai dengan tahun 2019 sudah 115 Desa di&nbsp; Kabupaten Purbalingga yang memiliki website dengan domain desa.id. Sedangkan pada tahun 2020 ini sedang dilakukan pembuatan website untuk 15 Desa yang telah selesai melakukan tahap pendaftaran nama domain.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sesuai Peraturan Menteri Komunikasi dan Informatika (Permenkominfo) Nomor 5 Tahun 2015 tentang Registrar Nama Domain Instansi Penyelenggara Negara Bab III Klasifikasi Nama Domain Pasal 4 ayat (2) disebutkan bahwa Instansi vertikal dari Instansi pusat yang berada di daerah, atau perwakilan di luar negeri, atau perangkat kewilayahan pada Pemerintah Daerah termasuk Pemerintah Desa, dapat menggunakan Nama Domain sebagai alamat elektronik resmi Instansi.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nama Domain Instansi harus dibuat sesuai format yang tertuang dalam Lampiran I Permenkominfo tersebut. Untuk Pemerintah Desa Format Nama Domain terdiri dari Karakter nama [Desa, atau singkatannya].desa.id sebagai contoh untuk&nbsp; Desa Karanganyar nama domainnya adalah&nbsp; karanganyar.desa.id</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pendaftaran nama domain untuk Pemerintahan Desa harus dilakukan oleh pihak Pemerintah Desa dengan cara mendaftar terlebih dahulu pada &nbsp;<a href="https://layanan.kominfo.go.id/">https://layanan.kominfo.go.id/</a>. Dengan melengkapi persyaratan yang terdiri dari :</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {"ordered":true} -->\n<ol><li>Surat Keputusan Pengangkatan Kepala Desa (Kades),</li><li>Surat Keputusan Kades tentang Pengangkatan Perangkat Desa, yang ditunjuk menjadi admin website Desa</li><li>Surat Kuasa kepada Perangkat Desa&nbsp;yang ditunjuk menjadi admin website Desa</li><li>Surat Permohonan dari Kades/Sekdes&nbsp;<a href="https://drive.google.com/file/d/1uzHCKLjEOkdZ84lVN7P30z5sXLj84Mn3/view?usp=sharing">Surat Permohonan Pendaftaran Domain</a></li><li>KTP Perangkat desa yang mendaftar.</li></ol>\n<!-- /wp:list -->', 'Wujud Keterbukaan Informasi Publik. Dinkominfo Purbalingga Fasilitasi Pembuatan Website Desa', '', 'publish', 'open', 'open', '', 'wujud-keterbukaan-informasi-publik-dinkominfo-purbalingga-fasilitasi-pembuatan-website-desa', '', '', '2020-03-10 03:13:06', '2020-03-10 03:13:06', '', 0, 'http://localhost/desa/?p=129', 0, 'post', '', 0),
